import './App.css';
import Nav from './components/navBar.js';
import Header from './components/Header.js';
import Pages from './components/Pages.js';
import Login from './components/Login.js'

function App() {
  return (
    <div className="App">
      <Nav/>
      <Header/>
      <Pages/>
      <Login/>
    </div>
  );
}

export default App;
